import GreenRow from '../GreenRow/GreenRow';
import YellowRow from '../YellowRow/YellowRow';

// create 5 rows in a vertical fashion
const RowList = () => {
    const createYellow = () => {
        return <YellowRow />;
    };
    return(
        <div>
            <GreenRow />
            <div style={{justifyContent: "row"}}>
                <YellowRow />
                {/* button that generates more yellowrow components */}
                <button onClick={createYellow}>+</button>;
                <button onClick={deleteYellow}>-</button>;
            </div>
        </div>
    );
}

export default RowList;
